$(document).ready(function(){$(".nav-tabs > li a[title]").tooltip();$('a[data-toggle="tab"]').on("shown.bs.tab",function(a){if($(a.target).parent().hasClass("disabled"))return!1});$(".prev-step").click(function(a){a=$(".wizard .nav-tabs li.active");prevTab(a)})});function nextTab(a){$(a).next().find('a[data-toggle="tab"]').click()}function prevTab(a){$(a).prev().find('a[data-toggle="tab"]').click()}$(".nav-tabs").on("click","li",function(){$(".nav-tabs li.active").removeClass("active");$(this).addClass("active")});